        private static List<V3.FullCategory> DeserializeCategories()
        {
            var response = JsonConvert.DeserializeObject<V3.CategoriesResponse>(_categoriesJson);
            return response?.Categories.ToList() ?? new();
        }

        public void Validate()
        {
            // ensure deserialization doesn't blow up
            var test1 = _allCategories.Value;
            // ensure categories have unique key
            var test2 = _partTypeMappings.Value;
        }

        /// <summary>
        /// Maps a DigiKey category to a Part Type Id
        /// </summary>
        /// <param name="category"></param>
        /// <returns></returns>
        public int? MatchToPartTypeId(V3.Category category)
        {
            // try match by id
            int.TryParse(category.ValueId, out var id);
            if (id > 0)
            {
                var match = MatchToPartTypeId(id);
                if (match != null)
                    return match;
            }

            // try match by name
            return MatchToPartTypeId(category.Value);
        }

        /// <summary>
        /// Maps a DigiKey category to a Part Type Id
        /// </summary>
        /// <param name="categoryId"></param>
        /// <returns></returns>
        public int? MatchToPartTypeId(int categoryId)
        {
            if (categoryId > 0 && _partTypeMappings.Value.ContainsKey(categoryId))
                return _partTypeMappings.Value[categoryId];
            return null;
        }

        /// <summary>
        /// Maps a DigiKey category name to a Part Type Id
        /// </summary>
        /// <param name="name"></param>
        /// <returns></returns>
        public int? MatchToPartTypeId(string? name)
        {
            if (!string.IsNullOrEmpty(name))
            {
                var match = RecursiveWhere(_allCategories.Value, name);
                if (match != null && _partTypeMappings.Value.ContainsKey(match.CategoryId))
                    return _partTypeMappings.Value[match.CategoryId];
            }
            return null;
        }

        private V3.FullCategory? RecursiveWhere(IEnumerable<V3.FullCategory> categories, string name)
        {
            if (!categories.Any())
                return null;
            var match = categories.FirstOrDefault(x => x.Name.Equals(name, StringComparison.InvariantCultureIgnoreCase));
            if (match == null)
                match = RecursiveWhere(categories.SelectMany(x => x.Children), name);
            return match;
        }

